import { Outlet } from 'react-router-dom';
import './App.css';
import Home from './Home';

function App() {
  return (
    <div>
      <div>
        <Home></Home>
        <Outlet></Outlet>
      </div>
      <h1>Access the Navbars to see the Contents of App...</h1>
    </div>
  );
}

export default App;
